import React from 'react';
import './Card.css';
import team1 from '../img/team-1.jpg';

const Card = () => {
    return (
        <div className='team-mem'>
            <div style={{ backgroundImage: "url(" + { team1 } + ")" }}>

            </div>
        </div>
    )
}

export default Card;
